import React, {Component} from 'react';
import "./style.css";
class Footer extends Component {
    render() {
        return (
            <footer>
                <div class="footer-copyright text-center py-3">Made with ♥ by Erëblina Berisha
                </div>
            </footer>
        );
    }
}

export default Footer;
